import React from 'react';
import { useNavigate } from 'react-router-dom';
import './GamesPage.css'

const GamesPage = () => {
  const navigate = useNavigate();

  // List of game buttons (easy to expand later)
  const gameButtons = [
    { label: 'Riddle', path: '/riddle' },
    { label: 'Puzzle', path: '/puzzle' },
    // Add more games here like: { label: 'Quiz', path: '/quiz' }
  ];

  return (
    <div className="games-page">
      <h2 className="games-title">Choose a Game</h2>
      <div className="games-button-container">
        {gameButtons.map((game, index) => (
          <button
            key={index}a
            className="game-button"
            onClick={() => navigate(game.path)}
            aria-label={`Play ${game.label}`}
          >
            {game.label}
          </button>
        ))}
      </div>
    </div>
  );
};

export default GamesPage;
